--
-- Name: create_monthly_partitions(date); Type: FUNCTION; Schema: public; Owner: domainflow
--

CREATE FUNCTION public.create_monthly_partitions(partition_date date) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    partition_suffix TEXT;
    start_date DATE;
    end_date DATE;
BEGIN
    partition_suffix := to_char(partition_date, 'YYYY_MM');
    start_date := date_trunc('month', partition_date);
    end_date := start_date + interval '1 month';
    
    -- Create generated_domains partition
    EXECUTE format('CREATE TABLE IF NOT EXISTS generated_domains_%s PARTITION OF generated_domains_partitioned
                    FOR VALUES FROM (%L) TO (%L)', 
                   partition_suffix, start_date, end_date);
    
    -- Create dns_validation_results partition
    EXECUTE format('CREATE TABLE IF NOT EXISTS dns_validation_results_%s PARTITION OF dns_validation_results_partitioned
                    FOR VALUES FROM (%L) TO (%L)', 
                   partition_suffix, start_date, end_date);
    
    -- Create http_keyword_results partition
    EXECUTE format('CREATE TABLE IF NOT EXISTS http_keyword_results_%s PARTITION OF http_keyword_results_partitioned
                    FOR VALUES FROM (%L) TO (%L)', 
                   partition_suffix, start_date, end_date);
    
    -- Create indexes for generated_domains partition
    EXECUTE format('CREATE INDEX CONCURRENTLY IF NOT EXISTS idx_generated_domains_%s_campaign_bulk 
                    ON generated_domains_%s (domain_generation_campaign_id, created_at) INCLUDE (domain_name, is_valid)', 
                   partition_suffix, partition_suffix);
    
    -- Create indexes for dns_validation_results partition
    EXECUTE format('CREATE INDEX CONCURRENTLY IF NOT EXISTS idx_dns_validation_%s_campaign_time 
                    ON dns_validation_results_%s (dns_campaign_id, created_at DESC) INCLUDE (domain_name, validation_status)', 
                   partition_suffix, partition_suffix);
    
    -- Create indexes for http_keyword_results partition
    EXECUTE format('CREATE INDEX CONCURRENTLY IF NOT EXISTS idx_http_keyword_%s_campaign_domain 
                    ON http_keyword_results_%s (http_keyword_campaign_id, domain_name) INCLUDE (validation_status, found_keywords_from_sets)', 
                   partition_suffix, partition_suffix);
                   
    RAISE NOTICE 'Created monthly partitions for: %', partition_suffix;
END;
$$;


ALTER FUNCTION public.create_monthly_partitions(partition_date date) OWNER TO domainflow;

--
-- Name: decode_cursor(text); Type: FUNCTION; Schema: public; Owner: domainflow
--

CREATE FUNCTION public.decode_cursor(cursor_value text) RETURNS TABLE(table_name text, id_value uuid, timestamp_value timestamp with time zone)
    LANGUAGE plpgsql IMMUTABLE
    AS $$
DECLARE
    decoded_parts TEXT[];
    decoded_text TEXT;
BEGIN
    decoded_text := convert_from(decode(cursor_value, 'base64'), 'UTF8');
    decoded_parts := string_to_array(decoded_text, '|');
    
    IF array_length(decoded_parts, 1) = 3 THEN
        RETURN QUERY SELECT
            decoded_parts[1]::TEXT,
            decoded_parts[2]::UUID,
            to_timestamp(decoded_parts[3]::NUMERIC);
    END IF;
    
    RETURN;
END;
$$;


