-- Name: campaign_performance_metrics; Type: VIEW; Schema: public; Owner: domainflow
--

CREATE VIEW public.campaign_performance_metrics AS
 SELECT current_phase,
    phase_status,
    count(*) AS campaign_count,
    avg(domains) AS avg_domains,
    avg(leads) AS avg_leads,
    avg(progress) AS avg_progress,
    avg((EXTRACT(epoch FROM (updated_at - created_at)) / (3600)::numeric)) AS avg_duration_hours
   FROM public.campaigns
  GROUP BY current_phase, phase_status;


